<style>

*{
margin:0px;
padding:0px;
box-sizing: border-box;
}
a {
       text-decoration: none;
    color: white;
}
body {

    color: white;
    background-size: cover;
    background-position: center center;
}
.contenar {
    display: flex;
    flex-direction: column;
    width: 90%;
    margin: 0px auto;
    align-items: center;
    gap: 10px;
    height: 100vh;
    justify-content: flex-start;
}
div#h1div {
    height: 5vh;
    margin-top: 10%;
    align-self: flex-start;
    font-size: 40px;
    margin-bottom: 15px;
}
div#inputdiv {
    display: flex;
    width: 100%;
    justify-content: flex-start;
    align-items: center;
    height: 15vh;
	margin-top: 4%;
	flex-wrap: wrap;
}
input#myInput {
    flex-basis: 50%;
    height: 40px;
    line-height: 13px;
    border-radius: 5px;
    text-align: center;
    font-size: 15px;
}
div#resdiv {
    display: flex;
    flex-direction: row;
    justify-content: flex-start;
    align-items: stretch;
    /* height: 80vh; */
    width: 100%;
    gap: 50px;
	flex-wrap: wrap;
}
div#pp {
    font-size: 30px;
    font-weight: 900;
    background: linear-gradient(178deg, #9e9e9e, #9e9e9e63);
    border-radius: 10px;
    padding: 15px;
}
div#tt {
    font-size: 30px;
    font-weight: 900;
    background: none;
    border-radius: 10px;
    padding: 15px;
}
#tt > table {
    margin: auto;
}
.Bg {
    display: none;
    position: absolute;
    top: 0px;
    z-index: -1;
    width: 100vw;
    height: 100vh;
    justify-content: center;
    align-items: stretch;
}
.header {
    display: flex;
    width: 90%;
    background: linear-gradient(180deg, #009688e0, transparent);
    justify-content: space-between;
    align-items: baseline;
    border-radius: 2px;
    margin-top: 15px;
    padding: 10px 20px;
}
ul.navUl {
    list-style: none;
}
li.navLi {
    display: inline-block;
    margin: 0px 20px;
}
button.clearBtn {
    border: none;
    border-radius: 5px;
    font-size: 20px;
    padding: 0px 10px;
    height: 38px;
    margin-left: 30px;
    background: #bfe4ff;
    color: black;
    text-transform: uppercase;
    transition: box-shadow 0.5s ease-in-out;
}
.clearBtn:hover {
    box-shadow: #99fdf4 0px 6px 30px;
}
button#clearbtn:active {
    background: #9e9e9e;
}
a.navA::after {
    content: '';
    width: 100%;
    height: 3px;
    border-radius: 2px;
    background: #bfe4ff;
    display: block;
    visibility: hidden;
}
a.navA:hover::after {
    visibility: visible;
}
/*---------------haide the imgx and imgy------------------------*/
#imgx, #imgy {
 display:none;
 width:200px;
 height:200px;
}

/*--------------------------------------------------.glow-on-hover-------------------------------------------*/
.glow-on-hover {
    width: 150px;
    height: 30px;
    border: none;
    vertical-align: middle;
    line-height: 13px;
    outline: none;
    color: #fff;
    //you can change the text button color here#fff: ;
    background: #111;
    cursor: pointer;
    position: relative;
    z-index: 0;
    border-radius: 10px;
    margin: 1%;
    font-size: 20px;
    font-weight: bold;
}
.glow-on-hover:before {
    content: '';
    background: linear-gradient(45deg, #ff0000, #ff7300, #fffb00, #48ff00, #00ffd5, #002bff, #7a00ff, #ff00c8, #ff0000);
    position: absolute;
    top: -2px;
    left:-2px;
    background-size: 400%;
    z-index: -1;
    filter: blur(5px);
    width: calc(100% + 4px);
    height: calc(100% + 4px);
    animation: glowing 20s linear infinite;
    opacity: 0;
    transition: opacity .3s ease-in-out;
    border-radius: 10px;	
}
.glow-on-hover:active {
    color: #000
}
.glow-on-hover:active:after {
    background: transparent;
}

.glow-on-hover:hover:before {
    opacity: 1;
}
.glow-on-hover:after {
    z-index: -1;
    content: '';
    position: absolute;
    width: 100%;
    height: 100%;
    background: #317b84;//you can change the button color here#111;
    left: 0;
    top: 0;
    border-radius: 10px;
	border: 2px solid #fff;
}
@keyframes glowing {
    0% { background-position: 0 0; }
    50% { background-position: 400% 0; }
    100% { background-position: 0 0; }
}
/*---------------------------------------------------------------------------------------------*/
</style>
